export default (function(a,b,c,d,e,f,g,h,i){return {data:{Wt5do2Tk9K:{data:{id:791,attributes:{imdbId:"tt4432058",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BYjBiNmVhN2QtZjM3OS00MDNjLTk4ZDEtZWZlYjAxMDM3ZGY2XkEyXkFqcGdeQXVyMjM3MTAzOTc@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"6.2\u002F10"}],item_lang:{data:{id:1454,attributes:{title:"The Deal",plot:"Tae-soo has been a lazy policeman, but accidentally he runs into Kang-cheon, whose car is covered with blood. Tae-soo suspects the worker to be the serial killer that kills young women for months. It is revealed that Kang-cheon killed Tae-soo's sister as well. Kang-cheon is sent to prison on a life sentence. Seung-hyeon, Tae-soo's brother in law wants to take revenge on Kang-cheon, and makes a deal with a prisoner to kill Kang-cheon in prison.",slug:"the-deal"}}},books:{data:[{id:742,attributes:{title:e,description:f,thumbnail:g,authors:[a],firstBook:true,published:h,publisher:b,subtitle:c}},{id:743,attributes:{title:e,description:f,thumbnail:g,authors:[a],firstBook:d,published:h,publisher:b,subtitle:c}},{id:744,attributes:{title:"Fortune & Fame",description:"Frenemies Jasmine and Rachel are approached by the producers of a popular reality TV show that will follow the lives of the wives of well known Baptist leaders in this new novel from the best-selling authors of Sinners & Saints. Original.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=ohHgAgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a,i],firstBook:d,published:"2014-02-25",publisher:b,subtitle:c}},{id:745,attributes:{title:"Sinners & Saints",description:"Bestselling and award-winning novelists Victoria Christopher Murray and ReShonda Tate Billingsley bring their favorite heroines together in a novel that will delight their legions of fans. TEAM JASMINE or TEAM RACHEL? Bestselling and award-winning novelists Victoria Christopher Murray and ReShonda Tate Billingsley bring their favorite heroines together in a novel that will delight their legions of fans. Jasmine Larson Bush and Rachel Jackson Adams are not your typical first ladies. But they’ve overcome their scandalous and drama-filled pasts to stand firmly by their husbands’ sides. When a coveted position opens up—president of the American Baptist Coalition—both women think their husbands are perfect for the job. And winning the position may require both women to get down and dirty and revert to their old tricks. Just when Jasmine and Rachel think they’re going to have to fight to the finish, the current first lady of the coalition steps in . . . a woman bigger, badder, and more devious than either of them. Double the fun with a message of faith, Sinners & Saints will delight readers with two of their favorite characters from two of their favorite authors.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=-2Ot7DbUnpsC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a,i],firstBook:d,published:"2012-01-10",publisher:b,subtitle:""}},{id:746,attributes:{title:"Stand Your Ground",description:"After a seventeen-year-old African American boy is shot dead by a white man, the boy's mother and the shooter's wife face difficulties.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=KT9IDQAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:d,published:"2016-10-25",publisher:b,subtitle:c}}]}}},meta:{}}},prerenderedAt:1680940953710}}("Victoria Christopher Murray","Simon and Schuster","A Novel",null,"The Deal, the Dance, and the Devil","What would you do for five million dollars? Adam and Evia Langston have lived in their own little garden of Eden since the two married at the age of seventeen. Working their way up from the humblest of beginnings, the Langstons have thrived beyond anything they could have ever imagined. Now they live in the finest home, drive the best cars, and indulge in all the trimmings that signify their massive success. But then the recession hits and rips apart the family’s financial stability. Unable to support their three children and other relatives, Adam and Evia find themselves drowning in financial trouble and teetering on the brink of complete disaster. With nowhere to turn, the Langstons have no idea what to do. Until Shay-Shaunté, Evia’s multimillionaire boss, comes to the Langstons with a five-million-dollar offer that seems so hard to refuse. Will the Langstons make this deal? Or will they recognize that the glitter of five million dollars may be far from gold?","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=hGVZRRlNYnAC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2011-06-07","ReShonda Tate Billingsley"))